import React from "react";
import {Tile} from "../tile/Tile";

export const TileList = ({data}) => {

  let tileArray = [];
  data.forEach((index, info) => {
    const {name, ...rest} = info;
    tileArray.push(<Tile key={index} name={name} description={rest}/>);
  })

  useEffect()

  return (
    <div>
      {tileArray}
    </div>
  );
};
